import React from 'react'
import "./Login.css"
const Login = () => {
  return (
   <section className='flexCenter '> 

                <div className='login-page flexCenter'>


                  <div className='login-main'>


                    <div className='flexColCenter'>
                               
                              <img src="./Foodian_logo.png" alt="logo" />
                              <h2>Welcome Back</h2>
                    </div>
                          


                    <div>


                      <form className='flexCnter' >
                                  <div>
                                        <label className='flexColStart'>
                                          <span>Email</span>
                                          <input></input>
                                        </label>
                                  </div>

                                  <div>
                                        <label className='flexColStart'>
                                          <span>Password</span>
                                          <input></input>
                                        </label>
                                  </div>
                                  <div>
                                    <button>Log In</button>
                                  </div>

                      </form>
                               
                               
                                                                                                     
                    </div>










                  </div>






                </div>
    
    
   </section>
  )
}

export default Login




